userDefinedLinkHintCss:
div > .vimiumHintMarker {
/* linkhint boxes */
background: #21ff93;
border: 1px solid black;
box-shadow: none;
}

div > .vimiumHintMarker span {
/* linkhint text */
color: black;
font-weight: bold;
font-size: 12px;
}

div > .vimiumHintMarker > .matchingCharacter {
color: gray;
}

#shadow-root > .vimiumHUDFrame {
bottom: 0;
}
